class Solution(object):    def findDuplicate(self, nums):        low = 0        high = len(nums) - 1        mid = int((high + low) / 2)        while high - low > 1:            count = 0            for k in nums:                if mid < k <= high:                    count += 1            if count > high - mid:                low = mid            else:                high = mid            mid = int((high + low) / 2)        return int(high)s=Solution()nums=[7,9,7,4,2,8,7,7,1,5]print(s.findDuplicate(nums))